package com.canfer.app.dto;

public class RutaAlmacenamientoDTO {
	
	private String ruta;
	private String descripcion;
	private String checkRuta;
	
	public RutaAlmacenamientoDTO() {
		//Auto-generated constructor stub
	}
	
	public String getRuta() {
		return ruta;
	}
	public void setRuta(String ruta) {
		this.ruta = ruta;
	}
	public String getDescripcion() {
		return descripcion;
	}
	public void setDescripcion(String descripcion) {
		this.descripcion = descripcion;
	}
	public String getCheckRuta() {
		return checkRuta;
	}
	public void setCheckRuta(String checkRuta) {
		this.checkRuta = checkRuta;
	}
	
	

}
